import React from 'react';

export default function Header() {
  return (
    <header className="h-[80vh] flex items-center flex-col p-6 md:p-12 lg:p-20">
      <div className="w-full h-full flex items-center flex-col bg-no-repeat bg-cover bg-fundo">
        <div className="w-full max-w-7xl flex items-center flex-row justify-between">
          <div className="flex items-start flex-col md:flex-row">
            <img
              src={`${process.env.PUBLIC_URL}/../../../assets/fabricando.PNG`}
              alt="Fabricando"
              className="w-full md:w-auto md:mr-8 lg:mr-12"
            />
            <img
              src={`${process.env.PUBLIC_URL}/../../../assets/digital.PNG`}
              alt="Digital"
              className="w-full md:w-auto"
            />
          </div>
          <img
            alt="Logo"
            src={`${process.env.PUBLIC_URL}/../../../assets/logoHeader.avif`}
            className="w-full lg:w-auto"
          />
        </div>
      </div>
    </header>
  );
}
